INSERT INTO `t_glossary` VALUES ('Accounting Periods','Business','A defined period of time whereby performance  reports may be extracted. (normally 4 week periods).',1),('Association','Technical','A relationship between two or more entities. Implies a connection of some type - for example one entity uses the services of another, or one entity is connected to another over a network link.',2),('Class','Technical','A logical entity encapsulating data and behaviour. A class is a template for an object - the class is the design, the object the runtime instance.',3),('Component Model','Technical','The component model provides a detailed view of the various hardware and software components that make up the proposed system. It shows both where these components reside and how they inter-relate with other components. Component requirements detail what responsibilities a component has to supply functionality or behavior within the system.',4),('Customer','Business','A person or a company that requests An entity to transport goods on their behalf.',5),('Deployment Architecture','Technical','A view of the proposed hardware that will make up the new system, together with the physical components that will execute on that hardware. Includes specifications for machine, operating system, network links, backup units &etc.',6),('Deployment Model','Technical','A model of the system as it will be physically deployed',7),('Extends Relationship','Technical','A relationship between two use cases in which one use case \'extends\' the behavior of another. Typically this represents optional behavior in a use case scenario - for example a user may optionally request a list or report at some point in a performing a business use case. ',8),('Includes Relationship','Technical','A relationship between two use cases in which one use case \'includes\' the behaviour. This is indicated where there a specific business use cases which are used from many other places - for example updating a train record may be part of many larger business processes.',9),('Use Case','Technical',' A Use Case represents a discrete unit of interaction between a user (human or machine) and the system. A Use Case is a single unit of meaningful work; for example creating a train, modifying a train and creating orders are all Use Cases.\r\nEach Use Case has a description which describes the functionality that will be built in the proposed system. A Use Case may \'include\' another Use Case\'s functionality or \'extend\' another Use Case with its own behaviour.\r\nUse Cases are typically related to \'actors\'. An actor is a human or machine entity that interacts with the system to perform meaningful work.',10);
UNLOCK TABLES;
/*!40000 ALTER TABLE `t_glossary` ENABLE KEYS */;

