L,'1',NULL,'0',3,0,NULL,1,NULL,'195',NULL,NULL,NULL,0,NULL,'{13A2BD70-1BBB-44b1-BDA5-978CF67A51D9}',NULL),(219,84,'unhook','Private','void','0',NULL,'0','Sequential','Restores the original syscall table with no semaphore held. Decreses the module usage count at the end. Uses the BKL for serialisation.',NULL,'0',NULL,'0',10,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{FE58E3FC-07F9-486a-82F4-558AF0D0223E}',NULL),(220,84,'hook','Private','void','0',NULL,'0','Sequential','Can use two method for hooking both of which do not take mSemaphore which should be taken by the caller.\r\n\r\nIf it detects talpa-syscallhook module to be loaded, it registers with it . In that case it does not increase mUseCnt and uses a set of hooks which also does not use mUseCnt. It is safe to do so since talpa-syscallhook does that for us and it would be a redundant work.\r\n\r\nOther method hooks into the actual system syscall table with the set of hooks which do use mUseCnt. It also Increases the module usage count (MOD_INC_USE_CNT), reference count (mUseCnt) . Uses the BKL for serialisation and synces all filesystem before hooking. Only the hooks which we are interested in are hooked (mHookingMask).\r\n',NULL,'0',NULL,'0',9,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{88BC307F-EF5F-44e6-A631-971CDD0DB9AA}',NULL),(221,84,'examineFile','Private','int','0',NULL,'0','Sequential','Given a filename, creates IFileInfo and examines it. (passes for examination to the associated intercept processor).',NULL,'0',NULL,'0',11,0,NULL,0,NULL,'0',NULL,NULL,NULL,0,NULL,'{4E08ACED-F0C7-4a06-A38D-B8A3301BBCDA}',NULL),(222,84,'examineFD','Private','int','0',NULL,'0','Sequential','Give a file descriptor, creates IFileInfo and examines it.',NULL,'0',NULL,'0',12,0,NULL,0,NULL,'0',NULL,NULL,NULL,0,NULL,'{5A8139D2-8921-4354-B2D5-616161CA6B4B}',NULL),(223,166,'hasBeenExternallyVetted','Public','bool','0',NULL,'0','Sequential','Returns true if the operation has been through an external vetting process.',NULL,'0',NULL,'0',8