LL,NULL,0,NULL,'{D618F08A-23A7-40e2-9E80-B3975CFC7F92}',NULL),(600,71,'enable','Public','Boolean','0',NULL,'0','Sequential','The filter should be enabled.\r\n\r\nReturns:\r\nTrue if the filter was enabled by this call or was already enabled, else false.',NULL,'0',NULL,'0',2,0,NULL,0,NULL,'0',NULL,NULL,NULL,0,NULL,'{9BF9BEBA-B7D0-4f81-8C1B-D5EE9383EAB3}',NULL),(601,71,'examine','Public','void','0',NULL,'0','Sequential','Call excludeClient to avoid recursive interception.\r\nCall routeRequest to find out to which group this interception goes. If no group is found return immediately.\r\n\r\nMeasure the lenght of various strings which will be put into packet and calculate the required packet size.\r\n\r\nConstruct a IThreadInfo object and allocate memory for VettingDetails and for a vetting details packet.\r\n\r\nFill in all the various details into the details and packet.\r\n\r\nCheck if we got an IFile object and create one if not.\r\n\r\nCheck if IFile object has an open file and try to open it if not. Return an error if the open fails.\r\n\r\nGet and increment the vetting id and increase the reference counts on the objects provided to us. Insert the details into the intercepted queue. Do proper locking while doing all of this.\r\n\r\nFinally wake up the clients registered in this group and call waitVettingResponse to wait for them.\r\n\r\nCall destroyVettingDetails and return.\r\n',NULL,'0',NULL,'0',0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{BEC16A3E-2390-4c84-8DAB-F5F826BC288A}',NULL),(602,71,'examine','Public','void','0',NULL,'0','Sequential','Conceptually the same as the other examine method. The packets are different and there is no IFile object.',NULL,'0',NULL,'0',1,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{403E4F52-EA2F-43e5-A39F-11AEF67DD36F}',NULL),(603,71,'isEnabled','Public','Boolean','0',NULL,'0','Sequential','Determine if the filter is currently enabled.\r\n\r\nReturns:\r\nTrue if the filter is currently enabled, else false.',NULL,'0',NULL,'0',4,0,NULL,0,NULL,'0',NULL,NULL,NULL,0,NULL,'{774816D8-4D08-4369-9FE0-85D7E99311DB}',NULL),(604,71,'deregisterClient','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','Deregister a client from the server.\r\n\r\nReturns:\r\nEither an OK or FAILresult packet as defined by the Vetting Client Protocol.',NULL,'0',NULL,'0',8,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{483DBB83-32EB-45c9-8677-308F9FC8021F}',NULL),(605,71,'destroyClient','Public','void','0',NULL,'0','Sequential','Checks if the client is still registered, if so, emit a warning and forcefully deregister it.\r\n\r\nFree the VettingClient structure.',NULL,'0',NULL,'0',10,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{52AABF83-07FE-419c-8166-D4F630202638}',NULL),(606,71,'initializeClient','Public','VettingClient*','0',NULL,'0','Sequential','Allocates an VettingClient structure and sets the client to be unregistered. \r\n\r\nFill in the process field.\r\n\r\nSets the protocol version for response packets.\r\n',NULL,'0',NULL,'0',9,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{9D5F578D-7014-46e0-BCF0-DC92C9CE5E8E}',NULL),(607,71,'obtainVettingDetails','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','Obtain vetting, extended vetting, extended only details, or a stream data packets.\r\n\r\nIf the client requested a stream operation, it will get the stream packet pending.\r\n\r\nIf the client calls this after it has already requested extended details we do not have anything to give, so it will get -EBUSY.\r\n\r\nIf the client is not currently vetting we will try to get him a new vetting job. Depending on the client preferences, it will either sleep or get -EAGAIN if there are no details available. Otherwise it will get the vetting details packet.\r\n\r\nIf the vetting is already in progress we will interpret this as a request for the extended vetting details. Will try to construct one and give it to the client.\r\n\r\nReturns:\r\nA VettingDetails, ExtVettingDetails, or ExtDetailsOnly packet if data was available. If no data was available then the operation will block according to the timeout set. If the timeout was 0 the method returns FAIL immediately with the result set to EAGAIN. Otherwsie the operation will block. If the operation is interupted during blocking then FAIL will be sent and the error code set to EINTR, if a timeout is specified and this expires a FAIL will be returned with the error code set to EAGAIN. All other failures result in FAIL with error codes appropriately set.',NULL,'0',NULL,'0',12,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{91D395AB-E756-41fb-A765-7D1499D7BB6A}',NULL),(608,71,'peekVettingQueue','Public','bool','0',NULL,'0','Sequential','Checks if there are pending vetting jobs for this client.\r\n\r\nProtects the list by taking the group lock.',NULL,'0',NULL,'0',11,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{FA795B99-12A2-4940-AFF6-B1422527A515}',NULL),(609,71,'processPacket','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','Serves as a main switchboard for received packets. Given any type of packet it knows what to do with it and calls the appropriate method. Returns a response packet if any.',NULL,'0',NULL,'0',9,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{3D0F6EE8-7DF9-4e01-B3F5-54C9C1314872}',NULL),(737,71,'queryMaxPacketSize','Public','unsigned int','0',NULL,'0','Sequential','Returns a maximum packet size in bytes that user can write into the interface. This does not contain the potential stream payload but only the basic packet types.',NULL,'0',NULL,'0',6,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{9E805896-0583-4268-B4CB-7E6272A1D866}',NULL),(738,71,'queryMaxStreamPacket','Public','unsigned int','0',NULL,'0','Sequential','Returns the maximum size of the stream packet+payload the implementation potentialy accepts.',NULL,'0',NULL,'0',8,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{9F9A220A-A947-46e6-9FA4-F2BC362EC564}',NULL),(612,71,'registerClient','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','Register a vetting client with the server. Fails with -ECHRNG if group is out of range.\r\n\r\nInitialise fields in the VettingClient including client id (proper locking).\r\n\r\nIncrements the number of registered clients in the group.\r\n',NULL,'0',NULL,'0',11,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{01B8D4F7-EABB-431e-80D9-C577E94D2A0A}',NULL),(613,71,'releaseVettingDetails','Public','void','0',NULL,'0','Sequential','After the client is finished with the packet obtained from obtainVettingDetails, it must release it!\r\n\r\nIf it was a stream operation we will just reset the instream flag.\r\n\r\nIf it was a job which doesn\'t require a response, we will consider this as a completion of this vetting and reset the client status and destroy the vetting details.\r\n',NULL,'0',NULL,'0',13,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{BF77EE4A-50DB-4e3e-B4D4-CBFB12BF024E}',NULL),(614,71,'setWaitTimeout','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','Set the timeout that the client requires when attempting to obtain details.\r\n\r\nTimeout is either zero or a positive number. Then convert it to jiffies and store it for internal use.\r\n\r\nReturns:\r\nEither an OK or FAILresult packet as defined by the Vetting Client Protocol.',NULL,'0',NULL,'0',10,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{BD81077E-5C2B-4ccb-985B-11B27D4142A1}',NULL),(615,71,'streamLength','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','If the stream is available returns the StreamData packet with the length of the stream  as only payload. In the case of error returns a FAIL packet with the code returned the IFile->length.\r\n\r\nIf the vetting is not in progress returns -ENOSR.\r\nIf client doesn\'t have a vetting details assigned returns -EPIPE.\r\nIf the file is not available returns -EBADF.\r\nIf the file is not open returns -ENOSTR.\r\n',NULL,'0',NULL,'0',16,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{E0C83FF5-F4A5-4a11-9921-FB04C1E036C7}',NULL),(616,71,'streamRead','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','If the stream is available returns the StreamData packet. In the case of error returns a FAIL packet with the code returned from IFile->read. Actual bytes read is stored in the packet.\r\n\r\nRequest for more than 128k - sizeof(struct TalpaPacket_StreamData) will return -EFBIG.\r\n\r\nIf the vetting is not in progress returns -ENOSR.\r\nIf client doesn\'t have a vetting details assigned returns -EPIPE.\r\nIf the file is not available returns -EBADF.\r\nIf the file is not open returns -ENOSTR.\r\n',NULL,'0',NULL,'0',20,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{8031AEEC-B4FB-4496-88A7-6D7F600BB006}',NULL),(617,71,'streamReadAt','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','Does a seek and then read, for possible scenarios see streamSeek and streamRead.',NULL,'0',NULL,'0',23,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{1EB6E253-9CDF-47f3-B917-DED530B51E56}',NULL),(618,71,'streamSeek','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','If the stream is available returns the OK packet. In the case of error returns the FAIL packet with the code returned by the IFile->seek.\r\n\r\nIf the vetting is not in progress returns -ENOSR.\r\nIf client doesn\'t have a vetting details assigned returns -EPIPE.\r\nIf the file is not available returns -EBADF.\r\nIf the file is not open returns -ENOSTR.\r\n',NULL,'0',NULL,'0',18,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{68C30799-6B5E-4520-A930-C80AE4BDDC90}',NULL),(619,71,'streamWrite','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','If the stream is available returns the StreamData packet. Actual bytes written is stored in the packet. In the case of error returns a FAIL packet with the code returned from IFile->write. \r\n\r\nIf the vetting is not in progress returns -ENOSR.\r\nIf client doesn\'t have a vetting details assigned returns -EPIPE.\r\nIf the file is not available returns -EBADF.\r\nIf the file is not open returns -ENOSTR.\r\n',NULL,'0',NULL,'0',22,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{C54B5ECE-8E43-49c6-AD3D-8520ECC88431}',NULL),(620,71,'streamWriteAt','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','Does a seek and then read, for possible scenarios see streamSeek and streamRead.',NULL,'0',NULL,'0',24,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{F1FA15A3-6E61-47da-B75A-0E3740FAD677}',NULL),(621,71,'vettingResponse','Public','struct TalpaProtocolHeader*','0',NULL,'0','Sequential','Inform the server of the client\'s response to a vetting.\r\n\r\nDepending on the response code from the packet, we will set the recommended action the the evaluation report.\r\n\r\nIf the client wasn\'t supposed to respond, or did something wrong, we will return an appropriate error.\r\n\r\nIf everything went fine, we will set the job as complete and wake up the process sleeping on the intercepted queue.\r\n\r\nThen we will reset the client since the vetting is now complete.\r\n',NULL,'0',NULL,'0',15,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{84F78746-0BB9-4490-BACE-DD0E32A65500}',NULL),(622,71,'routeRequest','Private','VettingGroup*','0',NULL,'0','Sequential','Take the config lock and iterate through the list of rules. Compare the path or filesystem with the each element until we find a match.\r\n\r\nIf no rules did match, select group zero.\r\n\r\nCheck if the selected group has any clients registered and if so, return the pointer to the group.\r\n\r\nOtherwise return NULL.\r\n\r\n',NULL,'0',NULL,'0',25,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{0E2EF6DB-0B4F-485f-9B97-85E45183C00E}',NULL),(623,71,'waitVettingResponse','Private','void','0',NULL,'0','Sequential','Sleep on the intercepted queue until being woken up by vetting completion or a request to re-open the file. Also, sleep for a maximum of mTimeout jiffies.\r\n\r\nIn the case vetting is complete set the externally vetted flag in the evaluation report and return.\r\n\r\nIf the re-open was requested, re-open the file with read-write permissions and complete the reopen completion port.\r\n\r\nIf we are woken up because the timeout expired unlink the job from the list (if still there) and set an error.\r\n\r\nIf we were interrupted by an signal, set an -EINTR error.\r\n',NULL,'0',NULL,'0',26,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{005DAB28-96B7-438d-97A8-B9935C3F5F12}',NULL),(624,71,'excludeClient','Private','bool','0',NULL,'0','Sequential','Take the clients lock and iterate throught the list of registerd clients. If the current process matches a client return true.\r\n\r\nOtherwhise return false.\r\n\r\nAlways release the lock before return.\r\n ',NULL,'0',NULL,'0',27,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{0A673CEA-A087-43f9-9A86-6FB5117DD7DF}',NULL),(625,71,'newObject','Private','VetCtrlConfigObject*','0',NULL,'0','Sequential','Notes for this method can be found in the filesystem exclusion processor.',NULL,'0',NULL,'0',28,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{A7B9B623-AD03-419c-8F00-B1AF2CED19D5}',NULL),(626,71,'deleteObject','Private','void','0',NULL,'0','Sequential','Notes for this method can be found in the filesystem exclusion processor.',NULL,'0',NULL,'0',29,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{F6BEBD71-066A-4f2b-95CE-E53A64DB9539}',NULL),(627,71,'constructStringSet','Private','void','0',NULL,'0','Sequential','Notes for this method can be found in the filesystem exclusion processor.',NULL,'0',NULL,'0',30,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{58B97D86-225A-409a-9922-F96C03FB0FE5}',NULL),(628,71,'destroyStringSet','Private','void','0',NULL,'0','Sequential','Notes for this method can be found in the filesystem exclusion processor.',NULL,'0',NULL,'0',31,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{BCA8E93E-23B5-45e5-B466-6B394962ABA2}',NULL),(629,71,'findObject','Private','VetCtrlConfigObject*','0',NULL,'0','Sequential','Notes for this method can be found in the filesystem exclusion processor.',NULL,'0',NULL,'0',32,0,NULL,0,NULL,NULL,NULL,NULL,NULL,0,NULL,'{0