INSERT INTO `t_rtfreport` VALUES ('Architecture Model',0,'C:\\TEMP\\Architecture.RTF',-1,-1,-1,'Architecture',-1,-1,-1,-1,-1,-1,0,-1,'The system architecture model defines the overall hardware/software architecture used to implement the system. ',0,0,0,0,0,NULL,NULL,NULL,NULL),('Class Model',0,'C:\\Temp\\ClassModel.RTF',-1,-1,-1,'Class Model',-1,-1,-1,-1,-1,-1,0,-1,'The logical model is made up of the Domain Model - a high level model of business objects and relationships between objects suitable for analysing the business process, and the class model - a rigorous model of classes and their inter-relationships, suitable for building a software product.',-1,-1,-1,0,0,NULL,NULL,NULL,NULL),('Component Model',0,'C:\\Temp\\Component.RTF',-1,-1,-1,'Component Model',-1,-1,-1,-1,-1,-1,0,-1,'The component model provides a detailed view of the various hardware and software components that make up the proposed system. It shows both where these components reside and how they inter-relate with other components. Component requirements detail what responsibilities a component has to supply functionality or behaviour within the system.\r\n',0,0,0,-1,-1,NULL,NULL,NULL,NULL),('Deployment',0,'C:\\Temp\\Deployment.RTF',-1,-1,-1,'Deployment Architecture',-1,-1,-1,-1,-1,-1,0,-1,'The Deployment View provides a detailed model of the way components will be deployed across the system infrastructure. It details network capabilities, server specifications, hardware requirements and other information related to deploying the proposed system.',0,0,0,0,0,NULL,NULL,NULL,NULL),('Development Products',0,'C:\\Temp\\DevelopProducts.RTF',-1,-1,-1,'Development Environment',-1,-1,-1,-1,-1,-1,0,-1,'The Development Environment model provides a detailed view of the various hardware and software components that are involved in the development of the application. It shows both where these components reside and how they inter-relate with other components. Component requirements detail what responsibilities a component has to supply functionality or behaviour within the system.\r\n',-1,-1,-1,0,0,NULL,NULL,NULL,NULL),('DRP',0,'C:\\temp\\DRP.RTF',-1,-1,-1,'DRP',-1,-1,-1,-1,-1,-1,0,-1,'The DRP model provides an overview of the proposed Disaster Recovery Procedures for the FMS application.\r\n',-1,-1,-1,0,0,NULL,NULL,NULL,NULL),('Dynamic Model',0,'C:\\Temp\\DM.RTF',-1,-1,-1,'Dynamic Model',-1,-1,-1,-1,-1,-1,0,-1,'The Dynamic Model provides a view of business processes that impact the proposed system. It shows how actors carry out high level business tasks to meet business demands. Business processes that will be performed by the proposed system will be ultimately implemented by the Use Cases detailed in the Use Case model.',-1,-1,-1,0,0,NULL,NULL,NULL,NULL),('Interviews',0,'D:\\vblocal\\projects\\FMS\\docs\\interviews.RTF',-1,-1,-1,'Interviews',-1,-1,-1,-1,-1,-1,0,-1,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL),('Release Management',0,'C:\\Temp\\ReleaseMan.RTF',-1,-1,-1,'Release Management',-1,-1,-1,-1,-1,-1,0,-1,'The Release Management model provides a detailed view of the various hardware and software components that are involved in the management of software versions released into the proposed production environment. It shows both where these components reside and how they inter-relate with other components. Component requirements detail what responsibilities a component has to supply functionality or behaviour within the system.\r\n',-1,-1,-1,0,0,NULL,NULL,NULL,NULL),('Use Case Model',0,'C:\\TEMP\\Use Case Model.RTF',-1,-1,-1,'Use Case Model',-1,-1,-1,-1,-1,-1,0,-1,'The Use Case Model describes the proposed functionality of the new system. A Use Case represents a discrete unit of interaction between a user (human or machine) and the system. A Use Case is a single unit of meaningful work; for example creating a train, modifying a train and creating orders are all Use Cases.\r\nEach Use Case has a description which describes the functionality that will be built in the proposed system. A Use Case may \'include\' another Use Case\'s functionality or \'extend\' another Use Case with its own behaviour.\r\nUse Cases are typically related to \'actors\'. An actor is a human or machine entity that interacts with the system to perform meaningful work.',0,0,0,0,0,NULL,NULL,NULL,NULL);
UNLOCK TABLES;
